const o={title:"\u4F7F\u7528\u8BF4\u660E",content:"# \u4F7F\u7528\u8BF4\u660E\n\u5982\u679C\u4F60\u8FD8\u4E0D\u4E86\u89E3 Markdown \u8BED\u6CD5\uFF0C\u53EF\u4EE5\u524D\u5F80 [Markdown \u5B98\u65B9\u6559\u7A0B](https://markdown.com.cn/) \u8FDB\u884C\u5B66\u4E60\u3002\n### \u6DFB\u52A0\u6587\u6863\n- \u65B0\u5EFA\u4E00\u7BC7\u6587\u6863\uFF1A\u70B9\u51FB\u83DC\u5355\u680F `\u65B0\u5EFA` \u6309\u94AE\u3002\n- \u5BFC\u5165\u672C\u5730\u7684\u6587\u6863\uFF1A\u70B9\u51FB\u83DC\u5355\u680F `\u5BFC\u5165` \u6309\u94AE\uFF0C\u7136\u540E\u9009\u62E9\u9700\u8981\u5BFC\u5165\u7684\u6587\u4EF6\u3002\n### \u5BFC\u51FA\u6587\u6863\n- \u5BFC\u51FA\u4E3A Markdown\uFF1A\u70B9\u51FB\u83DC\u5355\u680F `\u5BFC\u51FA` \u6309\u94AE\uFF0C\u7136\u540E\u70B9\u51FB `\u5BFC\u51FA\u4E3A Markdown`\u3002\n- \u5BFC\u51FA\u4E3A PDF\uFF1A\u70B9\u51FB\u83DC\u5355\u680F `\u5BFC\u51FA` \u6309\u94AE\uFF0C\u7136\u540E\u70B9\u51FB `\u5BFC\u51FA\u4E3A PDF`\u3002\n### \u4FDD\u5B58\n**Markdown Editor** \u53EF\u5C06\u6587\u6863\u4FDD\u5B58\u5728\u6D4F\u89C8\u5668 Local storage \u4E2D\uFF0C\u4F60\u53EA\u9700\u8981\u6309\u4E0B\u5FEB\u6377\u952E `ctrl+s` \u5373\u53EF\u5B8C\u6210\u4FDD\u5B58\u3002\u4F46\u662F\u6211**\u5EFA\u8BAE\u4F60\u5C06\u91CD\u8981\u6587\u6863\u5B58\u50A8\u5728\u66F4\u5B89\u5168\u7684\u5730\u65B9**\uFF0C\u4EE5\u514D\u53D1\u9001\u610F\u5916\u60C5\u51B5\u5BFC\u81F4\u6587\u6863\u4E22\u5931\uFF01"};export{o as default};
